import './checkout-item.style.scss';

const CheckoutItem = () => (
    <div className="checkout-item">
        <span>item1</span>
        <span>item2</span>
        <div className="image-container">
            <img src="" alt="" />
        </div>
    </div>
)

export default CheckoutItem;
